import React from 'react';
import './App.css';


const sudoku = [];




class Field extends React.Component{

  render(){

    return(
      <div class="field">

        {this.props.children}

      </div>
    )
  }
}


class RowOfSquares extends React.Component{

  render(){

    return(
      <div>

        <div class="square"></div>
        <div class="square"></div>
        <div class="square"></div>

      </div>
    )
  }
}


class Sudoku extends React.Component{

  render(){

    return(
      <div class="sudoku">

        <RowOfSquares/>
        <RowOfSquares/>
        <RowOfSquares/>

      </div>
    )

  }
}



function App() {
  return (
    <div className="App">

      <Sudoku/>

    </div>
  );
}

export default App;
